import {SERVER_URL} from "./constant";
import {useEffect, useState} from "react";

function Car() {

    const [cars, setCars] = useState()

    const getCars = async()=> {

        const response = await fetch(
            SERVER_URL + '/car'
        ).then((response) => response.json());

      setCars(response);
    }

    useEffect(() => {getCars()}, []);
    return (
        <table className="styled-table">
            <thead>
                <tr>
                    <th>Brand</th>
                    <th>Model</th>
                    <th>Year</th>
                </tr>
            </thead>
            <tbody>
            {cars && cars.map((car) =>
            <tr class="active-row" key={car.id}>
                <th>{car.brand}</th>
                <th>{car.model}</th>
                <th>{car.year}</th>
            </tr>
            )}
            </tbody>
        </table>
    );
}

export default Car;
